/* Theme: steelGray */
@theme reference {
  --color-steelGray-background: 0 0% 100%;
  --color-steelGray-foreground: 0 0% 3.9%;
  --color-steelGray-card: 0 0% 100%;
  --color-steelGray-card-foreground: 0 0% 3.9%;
  --color-steelGray-popover: 0 0% 100%;
  --color-steelGray-popover-foreground: 0 0% 3.9%;
  --color-steelGray-primary: 220 9% 46%;
  --color-steelGray-primary-foreground: 0 0% 98%;
  --color-steelGray-secondary: 210 20% 98%;
  --color-steelGray-secondary-foreground: 0 0% 9%;
  --color-steelGray-muted: 210 40% 96%;
  --color-steelGray-muted-foreground: 0 0% 45.1%;
  --color-steelGray-accent: 220 14% 96%;
  --color-steelGray-accent-foreground: 0 0% 9%;
  --color-steelGray-destructive: 0 72% 51%;
  --color-steelGray-destructive-foreground: 0 0% 100%;
  --color-steelGray-border: 214 32% 91%;
  --color-steelGray-input: 214 32% 91%;
  --color-steelGray-ring: 220 9% 46%;
}

.theme-steelGray {
  --color-background: var(--color-steelGray-background);
  --color-foreground: var(--color-steelGray-foreground);
  --color-card: var(--color-steelGray-card);
  --color-card-foreground: var(--color-steelGray-card-foreground);
  --color-popover: var(--color-steelGray-popover);
  --color-popover-foreground: var(--color-steelGray-popover-foreground);
  --color-primary: var(--color-steelGray-primary);
  --color-primary-foreground: var(--color-steelGray-primary-foreground);
  --color-secondary: var(--color-steelGray-secondary);
  --color-secondary-foreground: var(--color-steelGray-secondary-foreground);
  --color-muted: var(--color-steelGray-muted);
  --color-muted-foreground: var(--color-steelGray-muted-foreground);
  --color-accent: var(--color-steelGray-accent);
  --color-accent-foreground: var(--color-steelGray-accent-foreground);
  --color-destructive: var(--color-steelGray-destructive);
  --color-destructive-foreground: var(--color-steelGray-destructive-foreground);
  --color-border: var(--color-steelGray-border);
  --color-input: var(--color-steelGray-input);
  --color-ring: var(--color-steelGray-ring);
}

@media (prefers-color-scheme: dark) {
  .theme-steelGray {
    --color-background: 240 10% 3.9%;
    --color-foreground: 0 0% 98%;
    --color-card: 240 10% 3.9%;
    --color-card-foreground: 0 0% 98%;
    --color-popover: 240 10% 3.9%;
    --color-popover-foreground: 0 0% 98%;
    --color-primary: 220 9% 86%;
    --color-primary-foreground: 240 5.9% 10%;
    --color-secondary: 240 3.7% 15.9%;
    --color-secondary-foreground: 0 0% 98%;
    --color-muted: 240 3.7% 15.9%;
    --color-muted-foreground: 240 5% 64.9%;
    --color-accent: 220 14% 36%;
    --color-accent-foreground: 0 0% 98%;
    --color-destructive: 0 62.8% 30.6%;
    --color-destructive-foreground: 0 0% 98%;
    --color-border: 240 3.7% 15.9%;
    --color-input: 240 3.7% 15.9%;
    --color-ring: 220 9% 86%;
  }
}

